import React from 'react'
import { StyleSheet, Text, View, ImageBackground } from 'react-native'
import TableExample from './component/datatable'
import RipenessGraph from './component/chart'
import VarietyGraph from './component/chart2'
import AddData from './src'
import Table from './component/table'

const App = () => {
  return (
    <ImageBackground source={require('./assets/watermelon-seamless-pattern-green-stripes-vector-30741112.jpg')} style={styles.backgroundImage}>
      <View style={styles.container}>
        <View>
          <Text style={styles.title}>Watermelon Ripeness Result</Text>
        </View>
        <View style={styles.graph}>
          <View style={styles.column}>
            <AddData/>
            <Table/>
            <View style={styles.piegraph}>
              <RipenessGraph/>
              <VarietyGraph/>
            </View>
          </View>
            <TableExample/>
        <View>
          </View>
        </View>
      </View>
    </ImageBackground>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: 'transparent',
  },
  backgroundImage: {
    flex: 1,
    resizeMode: "cover",
    justifyContent: "center"
  },
  title: {
    fontSize: 50,
    fontWeight: "bold",
    color: "white",
    marginBottom: 20,
    marginLeft: 50
  },
  graph: {
    flex: 1,
    marginTop: 50,
    flexDirection: 'row',
    justifyContent: 'space-evenly',
    marginLeft: 15,
    marginRight: 25,
  },
  piegraph: {
    flex: 1,
    marginTop: 150,
    marginRight: 25,
    flexDirection: 'row',
    justifyContent: 'space-evenly',
  },
  column: {
    flex: 1,
    flexDirection: 'column',
    justifyContent: 'space-evenly',

  },
});

export default App;
